import React,{useState} from 'react'

const Form = () => {

  const [inp, setinp] = useState()

  const Submit = e => {

    e.preventDefault()

    setinp('')
}

  return (
    <div
    className='form' >

<form 
action=""
onSubmit={Submit}
>

    <input type="text"
    onChange={(e)=> setinp(e.target.value) }
     placeholder='Add Item ...'
      className='inp_css'
       />

    <input type="submit" 
     className='btn_css'
    />

</form>
    </div>
  )
}

export default Form
